const fs = require('fs');
const PDFDocument = require('pdfkit');


const addImage = (image) => {
  return new Promise(resolve => {
    request.get(image, (error, response, body) => {
      if (!error && response.statusCode === 200) {
        var img = new Buffer(body, 'base64');
        resolve(img);
      }
    })
  })
}

